import React from "react";
import './ErrorModal.css';

function ErrorModal(props) {
    function onConfirm() {
        props.onConfirm()
    }
  return (
    <div onClick={onConfirm}>
      <div className="modaL">
        <div className="bg-dark fs-2 title">{props.title}</div>
        <div className="bg-dark fs-4 message">{props.message}</div>
        <button className="btn-warning" onClick={onConfirm}>Okay</button>
      </div>
    </div>
  );
}

export default ErrorModal;
